import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SignUp from '/Users/v450/myphysiotherapist/src/components/SignUp.js';
import Login from '/Users/v450/myphysiotherapist/src/components/LogIn.js';
import Logout from '/Users/v450/myphysiotherapist/src/components/LogOut.js';
import Dashboard from '/Users/v450/myphysiotherapist/src/components/Dashboard.js';
import ProtectedRoute from './auth/ProtectedRoute';
import History from './TherapyHistory';


function App() {
  return (
    <Router>
      <h1>Welcome to My physiotherapist</h1>
      <p>My physiotherapist is app that can guide you though the basic rehabilitation process. 
        You can save your data of the exercises and days you finished in the history and keep track od your pain intensity in time.</p>

      <div>
        <nav>
          <ul>
            <li>
              <Link to="/signup">Sign Up</Link>
            </li>
            <li>
              <Link to="/login">Login</Link>
            </li>
            <li>
              <Link to="/logout">Logout</Link>
            </li>
            <li>
              <Link to="/signup">Sign Up</Link>
            </li>
          </ul>
        </nav>

        {/* Routes replaces Switch in react-router-dom v6 */}
        <Routes>
          <Route path="/signup" element={<SignUp />} />
          <Route path="/login" element={<Login />} />
          <Route path="/logout" element={<Logout />} />
          <Route 
          path="/dashboard" 
          element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          } 
        />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
